// src/Home.js
import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css'; // Import stylów CSS

function Home() {
  return (
    <body>
        <header>
        <h2>Welcome to Pizza Restaurant!</h2>
      </header>
      <article>
        <p>This is the home page content.</p>
      </article>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/menu">Menu</Link>
          </li>
        </ul>
      </nav>
    </body>
    
  );
}

export default Home;
